global debug
debug = False

def print_debug(s):
    global debug
    if debug:
        print(s)

def convert_little_endian(s):
    #convert 003043 into 433000
    length = int(len(s)/2)
    temp_str = ""
    for i in range(length):
        temp_str = s[i*2:i*2+2] + temp_str
    return temp_str

def convert_two_bytes_signed(s):
    num = int(s,16)
    #check if MSbit is set:
    MSB = num >> 15
    if not MSB:
        return num
    else:
        #need to negate
        return (((num ^ 0xFFFF) + 1)&0xFFFF)* -1

